import React from 'react';
import { Image, StyleSheet, Text, TouchableOpacity, View, ScrollView } from 'react-native';
import Tile from './Tile';

export default function ImageGallery(props) {
  return (
    <View style={styles.container}>
        <ScrollView style= {styles.gallery}>
            <Tile base64data = {props.cardArray[0]}></Tile>
            <Tile base64data = {props.cardArray[1]}></Tile>
            <Tile base64data = {props.cardArray[2]}></Tile>
            <Tile base64data = {props.cardArray[3]}></Tile>
            <Tile base64data = {props.cardArray[4]}></Tile>
            <Tile base64data = {props.cardArray[5]}></Tile>
            <Tile base64data = {props.cardArray[6]}></Tile>
            <Tile base64data = {props.cardArray[7]}></Tile>
        </ScrollView>
    </View>
  );
}

const styles = StyleSheet.create({
  instructions:{
    color: '#888', 
    fontSize: 18,
    marginHorizontal: 15,
  },
  gallery:{
    height: 300,
  },
  container: {
    flex: 1,
    height: 300,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  button: {
    backgroundColor: "blue",
    padding: 20,
    borderRadius: 5,
  },
  buttonText: {
    fontSize: 20,
    color: '#fff',
  }
});
